tvorher = '';

function stealMetas() {
//alert("ok");
	
	t = document.getElementById("meta").innerHTML;
	
	var res = t.split('"');
	var els = (res.length);
	var latlon = res[els - 2];
	var latlonarr = latlon.split(',');
	var lat = latlonarr[0];
	var lon = latlonarr[1];
	
	var adresse=document.getElementById("search").value;
	
	parent.showlatlonarr(latlonarr, adresse);
	//console.log('lat '+lat + ' / lon '+lon);
	
	
	
}

function watchMetas() {
	var t = document.getElementById("meta").innerHTML;
	if (t!=tvorher) {
		stealMetas();
		tvorher = t;
	}
	//console.log('tvorher '+tvorher);
}

setInterval(watchMetas, 300);